import Head from 'next/head'
import Link from 'next/link'
import CardBook from '../components/CardBook'

const Home = () => (
  <div className="container">

    <CardBook
      post={{
        title: 'aa',
        image: 'aa',
        user: {
          username: 'aa'
        },
        count: {
          like: 1
        }
      }}
    />
    <Head>
      <title>Create Next App</title>
      <link rel="icon" href="/favicon.ico" />
    </Head>

  </div>
)

export default Home
